import React from 'react';

const EntidadesPage = () => {
  return (
    <div className="container mt-5">
      <h1>Gestión de Entidades</h1>
      <p>Aquí puedes gestionar todas las entidades en la relación comercial, tanto clientes como todo tipo de provedores por tipo de servicio y mucho más.</p>
    </div>
  );
};

export default EntidadesPage;
